import React, { useEffect, useState } from "react";
import API from "../api";
import { useNavigate } from "react-router-dom";

const Dashboard = () => {
  const [urls, setUrls] = useState([]);
  const [inputUrl, setInputUrl] = useState("");
  const [error, setError] = useState("");
  const [loading, setLoading] = useState(false);
  const navigate = useNavigate();

  // Fetch user URLs
  const fetchUrls = async () => {
    setLoading(true);
    try {
      const { data } = await API.get("/url");
      setUrls(data);
    } catch (err) {
      console.error("âŒ Fetch URLs error:", err.response?.data || err.message);
      if (err.response?.status === 401) {
        setError("âš ï¸ Session expired. Please log in again.");
        setTimeout(() => navigate("/login"), 2000);
      } else {
        setError(err.response?.data?.message || "Failed to load URLs.");
      }
    } finally {
      setLoading(false);
    }
  };

  // Shorten new URL
  const shortenUrl = async (e) => {
    e.preventDefault();
    if (!inputUrl.trim()) {
      setError("Please enter a valid URL.");
      return;
    }
    try {
      await API.post("/url/shorten", { originalUrl: inputUrl });
      setInputUrl("");
      fetchUrls();
    } catch (err) {
      console.error("âŒ Shorten URL error:", err.response?.data || err.message);
      setError(err.response?.data?.message || "Failed to shorten URL.");
    }
  };

  useEffect(() => {
    fetchUrls();
  }, []);

  return (
    <div className="container mt-5">
      {/* Header + Shortener Page Button */}
      <div className="d-flex justify-content-between align-items-center mb-4">
        <h2 className="fw-bold">ðŸ“Š Your Dashboard</h2>
        <button
          className="btn btn-success shadow-sm"
          onClick={() => navigate("/shortener")}
        >
          âž• Go to LO Page
        </button>
      </div>

      {error && (
        <div className="alert alert-danger text-center" role="alert">
          {error}
        </div>
      )}

      {/* Shorten URL Form */}
      <div className="card p-4 shadow-lg mb-4">
        <form onSubmit={shortenUrl}>
          <div className="input-group">
            <input
              type="text"
              className="form-control"
              placeholder="Enter URL to shorten"
              value={inputUrl}
              onChange={(e) => setInputUrl(e.target.value)}
            />
            <button type="submit" className="btn btn-primary">
              Shorten
            </button>
          </div>
        </form>
      </div>

      {/* URLs List */}
      <div className="card p-4 shadow">
        <h4 className="mb-3">Your Shortened URLs</h4>

        {loading ? (
          <div className="text-center my-4">
            <div className="spinner-border text-primary" role="status"></div>
            <p className="mt-2">Loading URLs...</p>
          </div>
        ) : urls.length === 0 ? (
          <p className="text-muted">No URLs shortened yet.</p>
        ) : (
          <table className="table table-hover table-bordered">
            <thead className="table-dark">
              <tr>
                <th>Original URL</th>
                <th>Short URL</th>
                <th>Clicks</th>
              </tr>
            </thead>
            <tbody>
              {urls.map((url) => (
                <tr key={url._id}>
                  <td>
                    <a href={url.originalUrl} target="_blank" rel="noreferrer">
                      {url.originalUrl}
                    </a>
                  </td>
                  <td>
                    <a
                      href={`http://localhost:5000/api/url/${url.shortId}`}
                      target="_blank"
                      rel="noreferrer"
                    >
                      {`http://localhost:5000/api/url/${url.shortId}`}
                    </a>
                  </td>
                  <td>{url.clicks}</td>
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </div>
    </div>
  );
};

export default Dashboard;
